import MainHeader from "./components/Home/MainHeader";
import React from "react";
import HomePage from "./components/Home/HomePage";
import Music from "./components/Home/Music";

function App() {
  return (
    <React.Fragment>
      <HomePage/>
      <Music url = "/music/hashiraTheme.mp3" loop/>
    </React.Fragment>
  );
}

export default App;
